python.Example1:
def product_of_divisible(nums: list[int], m: int) -> int:
    result = 1
    for num in nums:
        if num % m == 0:
            result *= num
    return result

python.Example2:
def gen_rotations(s: str) -> list[str]:
    result = []
    for i in range(1, len(s)):
        result.append(s[i:] + s[:i])
    return result

def sum_of_rotations(s: str) -> int:
    result = 0
    for r in gen_rotations(s):
        result += int(r)
    return result
